package unit1;

public class NumberJumbler {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int result = 1214 + 58;
		// Insert any number operation above
		System.out.println(result + 11);
		// First number is night
		
		int result2 = result;
		
		result = result -30;
		
		System.out.println(result + result2 + 88);
		// Second number is day
		result = result * 3;
		
		result2 = result + 4;
		
		int fullresult = result + result2;
		
		System.out.println(fullresult * 420);
		// Seed
	}

}
